import React from 'react'

function Gradients() {
    return (

        <linearGradient id="blue-gradient" x1="100%" y1="100%" x2="0%" y2="0%">
            <stop stopColor="#7955ab" offset="0%" />
            <stop stopColor="red" offset="10%" />
            <stop stopColor="#d6a6be" offset="100%" />
        </linearGradient>

    )
}

export default Gradients
